import React, { lazy, Suspense } from 'react';
import { Row, Col } from 'antd';
//import { GlobalLoading } from './../../components';
import './styles.css';

function Home(props) {
    return (
        <Row gutter={[16, 16]}>
            <Col lg={12}>
                <ToolPost />
            </Col>
            <Col lg={12}>
                <ToolPost />                
            </Col>
        </Row>
    );
}
export default Home;
